import React from "react";

function TodoItem() {
  return (
    <li key={todo.id}>
      <label>
        <input
          type="checkbox"
          checked={todo.done}
          onChange={(e) => toogleTodo(todo.id, e.target.checked)}
        />
        {todo.title}
      </label>
      <button onClick={() => delTodo(todo.id)} className="btn btn-del">
        Delete
      </button>
    </li>
  );
}

export default TodoItem;
